import styled from "styled-components";

export const UserIconContainer = styled.div`
  height: 50px;
  width: 200px;
  border: solid black;
  display: flex;
`;
export const UserPhotoContainer = styled.div`
  height: 45px;
  width: 45px;
  border-radius: 50%;
  border: 1px solid gray;
  overflow: hidden;
`;
